import { motion } from "framer-motion"
import "../App.css"


function Projects (){
    return (
        <div className="containter">
            <motion.div className="box"
           animate={{rotate:180}}
           transition={{
               repeat:Infinity,
               ease: "easeIn",
               repeatType: "reverse",
               duration:2
           }}
            >
                <p className="pe">
                lautaro

                </p>
            </motion.div>
        </div>
      
);
}
export default Projects;
